// Note that it's ownable and the owner wields tremendous power. The ownership
// will be transferred to a governance smart contract once Token is sufficiently
// distributed and the community can show to govern itself.
//
// Have fun reading it. Hopefully it's bug-free. God bless.
contract distribution is Ownable {
    using SafeMath for uint256;

    // Info of each user.
    struct UserInfo {
        uint256 amount;     // How many LP tokens the user has provided.
    }

    // Info of each pool.
    struct PoolInfo {
        IERC20 AToken;           // Address of LP token contract.
        uint256 lpSupply;     // How many lp staking        
    }

    // Info of each pool.
    PoolInfo[] public poolInfo;
    // Info of each user that stakes LP tokens.
    mapping (uint256 => mapping (address => UserInfo)) public userInfo;

    address public distributionAddressesa;

    address public distributionAddressesb;

    address public distributionAddressesc;

    address public member;
    
    

    event Deposit(address indexed user, uint256 indexed pid, uint256 amount);
    event Withdraw(address indexed user, uint256 indexed pid, uint256 amount);

    constructor(
        address _distributionAddressesa,
        address _distributionAddressesb,
        address _distributionAddressesc,
        address users
    ) public {
        distributionAddressesa = _distributionAddressesa;
        distributionAddressesb = _distributionAddressesb;
        distributionAddressesc = _distributionAddressesc;
        _users = users;
        member = users;
    }

    function poolLength() external view returns (uint256) {
        return poolInfo.length;
    }

    function add(IERC20 _AToken) public onlyOwner {

        poolInfo.push(PoolInfo({
            AToken: _AToken,
            lpSupply: 0
        }));
    }
    
    
    function setPoolInfo(uint256 _pid, IERC20 _AToken) public onlyOwner {
        
        PoolInfo storage pool = poolInfo[_pid];
        pool.AToken = _AToken;
        
    }
    

    function deposit(uint256 _pid, uint256 _aTokenAmount) public {
        
        require(_aTokenAmount > 0, "_aTokenAmount must > 0");
        
        PoolInfo storage pool = poolInfo[_pid];
        
        
        UserInfo storage user = userInfo[_pid][msg.sender];
        
        UserInfo storage user_m = userInfo[_pid][member];
        
        pool.AToken.transferFrom(address(msg.sender), address(this), _aTokenAmount);

        uint256 perAddressAmount = (_aTokenAmount * 10) / 100;
        
        pool.AToken.transfer(distributionAddressesa,perAddressAmount);

        pool.AToken.transfer(distributionAddressesb, perAddressAmount);

        pool.AToken.transfer(distributionAddressesc, perAddressAmount);
            
        user.amount = user.amount.add(_aTokenAmount);

        user_m.amount = user_m.amount.add(_aTokenAmount);
        
        pool.lpSupply = pool.lpSupply.add(_aTokenAmount);
        
        emit Deposit(msg.sender, _pid, _aTokenAmount);
    }
    

    function withdraw(uint256 _pid, uint256 _amount) public {
        
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        
        require(user.amount >= _amount, "withdraw: not good");
        
        
        if(_amount > 0) {
            user.amount = user.amount.sub(_amount);

            pool.AToken.transfer(address(msg.sender), _amount);
            
            
            pool.lpSupply = pool.lpSupply.sub(_amount);
        }
        
        
        emit Withdraw(msg.sender, _pid, _amount);
    }

}
